import React, { Component } from 'react';
import Header from './HeaderComponent.jsx';

const propTypes = {
  children: PropTypes.number.isRequired
};

export default class AppPage extends Component {

  render() {
    return (
      <div>
        <Header />
        {this.props.children}
      </div>
    );
  }
}

AppPage.propTypes = propTypes;
